import React from "react";

import { HomeStyles } from "../2_styles/1_layout/HomeStyles.js";

import bgImg from "../3_images/1_home/bg_home.jpg";
import bgLogo from "../3_images/1_home/icon_home.png";

export default function Home() {
  return (
    <div>
      <HomeStyles.BgImg bgImg={bgImg}>
        <div className="bg_img"></div>
      </HomeStyles.BgImg>
      <HomeStyles.BgLogo bgLogo={bgLogo}>
        <div className="bg_logo"></div>
      </HomeStyles.BgLogo>
      <HomeStyles.Title>
        <div className="title">
          <p>the</p>
          <p>avengers</p>
        </div>
      </HomeStyles.Title>
      <div className="line"></div>
    </div>
  );
}
